        {
            switch (e.KeyChar)
            {
            case 'd':
                    chars = new char[5];
                    chars[0] = 'd';
            	break;
                case 'c':
                    if(chars[0]=='d'&&chars[1]=='c')
                        chars[2]='c';
                    else if(chars[0]=='d')
                        chars[1]='c';
                    else
                        chars = new char[5];
                    break;
                case 'e':
                    if(chars[0]=='d'&&chars[1]=='c'&&chars[2]=='c')
                        chars[3] = 'e';
                    else
                        chars = new char[5];
                    break;
                case ',':
                    if (chars[0] == 'd' && chars[1] == 'c' && chars[2] == 'c' && chars[3] == 'e')
                        chars[4] = ',';
                    else
                        chars = new char[5];

                    string str = new string(chars);
                    if (str == "dcce,")
                        MessageBox.Show(key);
                    break;


            }
        }

