    public class Cryptography3DES
    {
        TripleDESCryptoServiceProvider TripleDes = new TripleDESCryptoServiceProvider();
        public Cryptography3DES(string key)
        {
            TripleDes.Key = TruncateHash(key, TripleDes.KeySize / 8);
            TripleDes.IV = TruncateHash("", TripleDes.BlockSize / 8);
        }
        private byte[] TruncateHash(string key, int length)
        {
            SHA1CryptoServiceProvider sha1 = new SHA1CryptoServiceProvider();
            byte[] keybytes = Encoding.Unicode.GetBytes(key);
            byte[] hash = sha1.ComputeHash(keybytes);
            List<byte> hashL = new List<byte>();
            for (int i = 0; i < length; i++)
            {
                if (hash.Length <= i)
                    hashL.Add(0);
                else
                {
                    hashL.Add(hash[i]);
                }
            }
            return hashL.ToArray();
        }

        public string EncryptData(string text)
        {
            byte[] textbytes = Encoding.Unicode.GetBytes(text);
            MemoryStream ms = new MemoryStream();
            CryptoStream encStream = new CryptoStream(ms, TripleDes.CreateEncryptor(), CryptoStreamMode.Write);
            encStream.Write(textbytes, 0, textbytes.Length);
            encStream.FlushFinalBlock();
            return Convert.ToBase64String(ms.ToArray());
        }
        public string DecryptData(string enctext)
        {
            byte[] enctextbytes = Convert.FromBase64String(enctext);
            MemoryStream ms = new MemoryStream();
            CryptoStream decStream = new CryptoStream(ms, TripleDes.CreateDecryptor(), CryptoStreamMode.Write);
            decStream.Write(enctextbytes, 0, enctextbytes.Length);
            decStream.FlushFinalBlock();
            return Encoding.Unicode.GetString(ms.ToArray());

        }
    }
